      "path": "src/cli.ts",
      "content": "declare const require: any;

const fs = require('node:fs');
const path = require('node:path');
const yargs = require('yargs');
const { hideHelp } = require('yargs');

// Import TaskStore from './store.js' but we are in dist/ so we use require
const { TaskStore } = require('./store.js');

// CLI commands
function listCommand(args: any) {
  const store = new TaskStore(args.data);
  const tasks = store.list();
  return { ok: true, tasks };
}

function addCommand(args: any) {
  const store = new TaskStore(args.data);
  const task = store.add(args.title);
  return { ok: true, task };
}

function doneCommand(args: any) {
  const store = new TaskStore(args.data);
  const task = store.done(args.id);
  return { ok: true, task };
}

function removeCommand(args: any) {
  const store = new TaskStore(args.data);
  const task = store.remove(args.id);
  return { ok: true, task };
}

// Parse arguments
const argv = yargs(process.argv.slice(2))
  .usage('$0 <command> [args]')
  .command('list', 'List tasks', {
    data: {
      type: 'string',
      description: 'Path to tasks data file',
      demandOption: true,
    },
  },
  listCommand)
  .command('add', 'Add a new task', {
    title: {
      type: 'string',
      description: 'Task title',
      demandOption: true,
    },
    data: {
      type: 'string',
      description: 'Path to tasks data file',
      demandOption: true,
    },
  },
  addCommand)
  .command('done', 'Mark task as done', {
    id: {
      type: 'string',
      description: 'Task ID',
      demandOption: true,
    },
    data: {
      type: 'string',
      description: 'Path to tasks data file',
      demandOption: true,
    },
  },
  doneCommand)
  .command('remove', 'Remove a task', {
    id: {
      type: 'string',
      description: 'Task ID',
      demandOption: true,
    },
    data: {
      type: 'string',
      description: 'Path to tasks data file',
      demandOption: true,
    },
  },
  removeCommand)
  .help(false)
  .strict()
  .argv;"
